// src/models/mock-event.ts
import Event from './event';

export const EVENTS: Event[] = [
    new Event(
        1,
        "Événement 80s",
        "https://example.com/event80s.jpg", // Specific image URL for this event
        ["80s"],
        new Date(),
        100,
        "Lieu de l'événement",
        "Objectif de l'événement"
    ),
    // ... other events ...
];
